import React, { useState } from 'react';
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';


function UserInput() {
  const [userInput, setUserInput] = useState('Find the summary of connected flights in Changi in Feb');

  const handleInputChange = (e) => {
    setUserInput(e.target.value);
  };

  return (
    <div>
      <h2>Home</h2>
      <p>
        1. Put your request here:
        Given the table list:
        A1: flight table
        B1: passenger table
        C1: city table
      </p>
      <label>
        Enter what you want to check:
        <input type="text" value={userInput} onChange={handleInputChange} />
      </label>

      <Box
        component="form"
        sx={{
          '& > :not(style)': { m: 1, width: '75ch'},
        }}
        noValidate
        autoComplete="off"
      >
        <TextField id="outlined-basic" label="Enter what you want to check" variant="outlined" />

        {/* <TextField id="filled-basic" label="Filled" variant="filled" />
        <TextField id="standard-basic" label="Standard" variant="standard" /> */}

      </Box>

    </div>
  );
}

export default UserInput;
